var gzhBox=function(){
	if(document.getElementById("gzh")) return;	
	if(document.getElementById("gzhStyle")){
		
	}else{
		var gzhStyle = document.createElement("style");
		var str="";
		str+="#model_gzh{width: 100%;height: 100%;background: rgba(0,0,0,0.4);position: fixed;left: 0;top: 0;z-index: 99999;}";
	    str+="#gzh{width: 65%;position: fixed;left: 17.5%;top: 50%;-webkit-transform: translate(0,-50%);-moz-transform: translate(0,-50%);-ms-transform: translate(0,-50%);transform: translate3d(0,-50%,0);background: #FFFFFF;border-radius: 8px;z-index: 100000;overflow: hidden;}";
	    str+="#gzhImg{width: 75%;margin: 0 auto;margin-top: 18px;display: block;}";			
	    str+="#gzh p{font-size:14px;color:#545454;text-align:center;line-height: 28px;}";
		gzhStyle.type="text/css";
		gzhStyle.id="gzhStyle";
		gzhStyle.appendChild(document.createTextNode(str));
		document.getElementsByTagName("head")[0].appendChild(gzhStyle); 
	}
	var model_gzh=document.createElement("div");
	model_gzh.id="model_gzh";
	var gzh=document.createElement("div");
	gzh.id="gzh";
	gzh.innerHTML="<img src=\"\" id=\"gzhImg\" /><p>长按后识别二维码</p><p>快来关注我吧</p>";
	gzh.style.height=1.14*parseInt(window.getComputedStyle(gzh).width)+"px";
	document.body.appendChild(model_gzh);
	document.body.appendChild(gzh);
	var src="data:image/png;base64,";
	var gzhImg=document.getElementById("gzhImg");
	gzhImg.src=src;
	
	var model_gzh=document.getElementById("model_gzh"),
	gzh=document.getElementById("gzh");
	[model_gzh,gzh].forEach(function(value, index, array){
		value.addEventListener("touchmove",function(e){
			e.preventDefault();
		},false);
	});
	
	model_gzh.addEventListener('touchstart',function(){
		document.body.removeChild(model_gzh);
		document.body.removeChild(gzh);
	},false);
}